interface AgencyIconProps {
  agency: Agency;
  className?: string;
  fillColor?: string;
}

export const AgencyIcon: FunctionComponent<AgencyIconProps> = ({
  agency,
  className,
  fillColor,
}) => {
  const Components: Record<Agency, FunctionComponent<IconProps>> = {
    "aadk": NTRCIcon,
    "bnm": BNMIcon,
    "bomba": BOMBAIcon,
    "dosm": DOSMIcon,
    "epf": EPFIcon,
    "epu": IPREPUIcon,
    "govt": JataNegara,
    "icu-jpm": ICUJPMIcon,
    "imigresen": JIMIcon,
    "jakoa": JAKOAIcon,
    "jpa": JPAIcon,
    "jpj": JPJIcon,
    "jpn": JPNIcon,
    "jps": MET_FloodIcon,
    "ktmb": MOTIcon,
    "kwap": KWAPIcon,
    "lhdn": LHDNIcon,
    "mampu": MAMPUIcon,
    "mcmc": MCMCIcon,
    "mers-999": MERSIcon,
    "met": METIcon,
    "moe": MOEIcon,
    "mof": MOFIcon,
    "moh": MOHIcon,
    "mot": MOTIcon,
    "ntrc": NTRCIcon,
    "pdn": PDNIcon,
    "pdrm": PDRMIcon,
    "perkeso": SOCSOIcon,
    "phcorp": PHCorpIcon,
    "prasarana": MOTIcon,
    "spr": SPRIcon,
    "ssm": SSMIcon,
    "unhcr": UNHCRIcon,
  };

  const Icon = Components[agency];

  if (typeof Icon !== "undefined") {
    return createElement(Icon, { className, fillColor });
  }
  return createElement(Components["govt"], { className });
};

export default AgencyIcon;
